import React from 'react'

const Transaction = props => {
  const transactionData = props.transactionData.attributes
  return (
    <>
      {transactionData.method} ({transactionData.stock.ticker}) - {transactionData.quantity} {transactionData.quantity ? "Share" : "Shares"} @ ${transactionData.price}
    </>
  )
}

export default Transaction
